What specific use cases do you have in mind?
For example, some time ago we added `@TrueOnNull` https://github.com/facebook/infer/blob/97bc95e8c920196d91a9d48cb4ac93f6c43b8187/infer/tests/codetoanalyze/java/eradicate/NullMethodCall.java#L248 to support boolean functions on objects that return `true` when the object is `null`. They can then be used as in https://github.com/facebook/infer/blob/97bc95e8c920196d91a9d48cb4ac93f6c43b8187/infer/tests/codetoanalyze/java/eradicate/NullMethodCall.java#L261.

